<!DOCTYPE html>
<!-- saved from url=(0259)https://eu-browse.startpage.com/av/anon-image?piurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Fthumb%2F2%2F23%2FDropbox_Logo_01.svg%2F1200px-Dropbox_Logo_01.svg.png&sp=1588543781Tcd02ae0b1c4c2e1ae12f374ba87cecdec7ad0ce1c8fd1692b2ff73d1fe0b197e -->
<html data-component-base="" lang="en"><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
<style>
    html,
    body {
        font-family: 'Arial', sans-serif;
    }
    #image-container {
        display: flex;
        flex-direction: column;
        justify-content: center;
        height: 100vh;
        width: 100%;
    }

    #error-container {
        height: 100vh;
        width: 100%;
    }

    #image {
        max-width: 100%;
        max-height: 100%;
        margin: auto;

        -webkit-animation: fadein 0.5s; /* Safari, Chrome and Opera > 12.1 */
        -moz-animation: fadein 0.5s; /* Firefox < 16 */
        -ms-animation: fadein 0.5s; /* Internet Explorer */
        -o-animation: fadein 0.5s; /* Opera < 12.1 */
        animation: fadein 0.5s;
    }

    #error {
        text-align: center;
        color: #3b435c;
        padding-top: 15rem;
    }

    @keyframes fadein {
        from { opacity: 0; }
        to   { opacity: 1; }
    }

    /* Firefox < 16 */
    @-moz-keyframes fadein {
        from { opacity: 0; }
        to   { opacity: 1; }
    }

    /* Safari, Chrome and Opera > 12.1 */
    @-webkit-keyframes fadein {
        from { opacity: 0; }
        to   { opacity: 1; }
    }

    /* Internet Explorer */
    @-ms-keyframes fadein {
        from { opacity: 0; }
        to   { opacity: 1; }
    }

    /* Opera < 12.1 */
    @-o-keyframes fadein {
        from { opacity: 0; }
        to   { opacity: 1; }
    }

    /* theme styles */
    .dark {
        background-color: #1f2943;
    }

    .nite,
    .blak {
        background-color: #000;
    }

    .dark #error,
    .nite #error,
    .blak #error {
        color: #fff;
    }
</style>
